cy.fixture("registry/routes.admin.json").then(function (routesCfg) {
    cy.fixture("registry/access.matrix.json").then(function (m) {
        var baseUrl = Cypress.env(routesCfg.baseUrlEnv);
        var redirect = m.redirectWhenDenied || "/login";
        var routeByKey = new Map();
        routesCfg.routes.forEach(function (r) { return routeByKey.set(r.key, r); });
        m.roles.forEach(function (role) {
            cy.log("Testing as role: ".concat(role));
            m.rules.forEach(function (rule) {
                var route = routeByKey.get(rule.routeKey);
                if (!route)
                    return;
                var allowed = rule.allowed.includes(role);
                cy.log("Testing access to ".concat(route.key, " (").concat(route.path, ") - Expected Allowed: ").concat(allowed));
                // Clean state before each check
                cy.logout();
                if (role !== "guest")
                    cy.loginAs(role);
                cy.visitRoute(routesCfg.baseUrlEnv, route.path);
                if (!allowed) {
                    cy.url().should("include", redirect);
                }
                else {
                    cy.url().should("not.include", redirect);
                    cy.assertNoAppCrash();
                }
            });
        });
    });
});
